describe('Elements', () => {

    it('Page-title-is-correct', () => {
        browser.url('/');
        const title = browser.getTitle();
        console.log('Title is: ' + title);
    })

    it('Page-URL-is-correct', () => {
        const URL = browser.getUrl();
        console.log('URL is: ' + URL);
    })

})

